Setiap orang berhak atas perlindungan dan pemenuhan hak ekonomi, sosial dan budaya yang dijamin oleh hukum. Perlindungan dan pemenuhan hak ekonomi, sosial dan budaya tersebut meliputi:

a. Hak untuk memperoleh pekerjaan yang layak dan penghidupan yang layak;

b. Hak untuk memperoleh pendidikan dan pelatihan;

c. Hak untuk memperoleh kesehatan;

d. Hak untuk memperoleh perlindungan sosial;

e. Hak untuk memperoleh hak-hak sosial dan budaya;

f. Hak untuk memperoleh hak-hak ekonomi; dan

g. Hak untuk memperoleh perlindungan hukum.

